import React, { useState } from 'react';
import './styles.css';

function App() {
  const [gameStarted, setGameStarted] = useState(false);
  const [numPlayers, setNumPlayers] = useState(2);
  const [numRounds, setNumRounds] = useState(5);
  const [players, setPlayers] = useState([]);
  const [currentPlayer, setCurrentPlayer] = useState(0);
  const [deck, setDeck] = useState([]);
  const [tableCard, setTableCard] = useState(null);

  // Initialize deck
  const initializeDeck = () => {
    const suits = ['Hearts', 'Diamonds', 'Clubs', 'Spades'];
    const values = Array.from({ length: 13 }, (_, i) => i + 1);
    const newDeck = [];

    for (const suit of suits) {
      for (const value of values) {
        newDeck.push({ suit, value });
      }
    }
    return newDeck.sort(() => Math.random() - 0.5);
  };

  // Start game
  const handleStartGame = () => {
    const newDeck = initializeDeck();
    const newPlayers = Array.from({ length: numPlayers }, (_, i) => ({
      id: i,
      name: `Player ${i + 1}`,
      hand: [],
      score: 0,
    }));

    // Deal 5 cards to each player
    for (let i = 0; i < 5; i++) {
      for (let player of newPlayers) {
        player.hand.push(newDeck.pop());
      }
    }

    setDeck(newDeck);
    setPlayers(newPlayers);
    setTableCard(newDeck.pop());
    setGameStarted(true);
  };

  if (!gameStarted) {
    return (
      <div className="game-container">
        <div className="setup-form">
          <h1 className="title">Fadu Card Game</h1>
          
          <div className="input-group">
            <label>Number of Players:</label>
            <input
              type="number"
              min="2"
              max="8"
              value={numPlayers}
              onChange={(e) => setNumPlayers(parseInt(e.target.value))}
            />
          </div>

          <div className="input-group">
            <label>Number of Rounds:</label>
            <input
              type="number"
              min="1"
              value={numRounds}
              onChange={(e) => setNumRounds(parseInt(e.target.value))}
            />
          </div>

          <button className="start-button" onClick={handleStartGame}>
            Start Game
          </button>
        </div>
      </div>
    );
  }

  // Game interface
  return (
    <div className="game-container">
      <div className="game-board">
        <h1 className="title">Current Player: {players[currentPlayer]?.name}</h1>
        
        {/* Scores */}
        <div className="scores-container">
          {players.map(player => (
            <div key={player.id} className="player-score">
              {player.name}: {player.score} points
            </div>
          ))}
        </div>

        {/* Table card */}
        <div className="table-area">
          <div className="table-card">
            {tableCard && (
              <div className="card">
                {tableCard.value} of {tableCard.suit}
              </div>
            )}
          </div>
        </div>

        {/* Player's hand */}
        <div className="player-hand">
          <h2>Your Cards:</h2>
          <div className="cards-container">
            {players[currentPlayer]?.hand.map((card, index) => (
              <div key={index} className="card">
                {card.value} of {card.suit}
              </div>
            ))}
          </div>
        </div>

        {/* Game controls */}
        <div className="controls">
          <button className="game-button">Draw Card</button>
          <button className="game-button">Play Card</button>
          <button className="game-button">Call</button>
        </div>
      </div>
    </div>
  );
}

export default App;
